import React from "react";
import Button from "@mui/material/Button";
import Grid from "@mui/material/Grid";
import Paper from "@mui/material/Paper";
import Box from "@mui/material/Box";
import Typography from "@mui/material/Typography";
import backgroundImage from "../assets/BackgroundImage.png";
import logo from "../assets/logo.png";
import campechana from "../assets/campechana.png";

const array = ["hola", "hola2", "hola3"];

function Home() {
  return (
    <Box
      sx={{
        backgroundImage: `url(${backgroundImage})`,
        backgroundSize: "cover",
        minHeight: "100vh",
        flexDirection: "column",
        justifyContent: "center",
        alignItems: "center",
      }}
    >
      <>
        {array.map((element) => {
          return <Button variant="text">{element}</Button>;
        })}

        <Grid container spacing={2}>
          <Grid item xs={3}></Grid>
          <Grid item xs={6}>
            <Paper sx={{ borderRadius: "25px", backgroundColor: "black", display: "flex", justifyContent: "center", alignItems: "center" }} elevation={5}>
              <img src={logo} alt="logo" style={{ width: "80%", height: "auto", padding: "1rem" }} />
            </Paper>
          </Grid>
          <Grid item xs={3}></Grid>
        </Grid>


        <h1>Promociones</h1>
        <Paper sx={{
          borderRadius: "25px",
          backgroundColor: "black",
          display: "flex",
          justifyContent: "center",
          alignItems: "center",
          position: "relative"
        }} elevation={5}>
          <div style={{ width: "50%", height: "100%", backgroundColor: "red", position: "absolute", left: 0 }}>

            <Grid container rowSpacing={1} columnSpacing={{ xs: 1, sm: 2, md: 3 }}>
              <Grid item xs={12}>
                <h1>3 x 2</h1>
              </Grid>
              <Grid item xs={12}>
                <h2>Campechanas</h2>
              </Grid>
              <Grid item xs={12}>
              <h3>De $297 a</h3>
              </Grid>
              <Grid item xs={6}>
                <h1></h1>
              </Grid>
            </Grid>

          </div>
          <img src={campechana} alt="campechana" style={{ width: "100%", height: "100%", objectFit: "cover" }} />
        </Paper>

      </>
    </Box>
  );
}

export default Home;
